import Link from "next/link";
import Nav from "../components/Nav";
import styled from 'styled-components'


export default function Header() {
  return (
    <header>
      <div className="bar">
        <Link href="/">
          <h1>Stick Fits</h1>
        </Link>
      </div>
      <div className="sub-bar">
        <p> Search</p>
      </div>
      <Nav />
    </header>
  );
}
